import React from 'react';
import TeamMember from '..';
function Team() {
	return (
		<div className="row ">
			<TeamMember
				info={{
					img: './images/01.jpg',
					name: 'eman',
					position: 'oman',
					phone: '+91 999 121211212',
					email: 'eman@b-sa.com',
					website: 'eman.com'
				}}
			/>
		</div>
	);
}
export default Team;
